import React, { Component } from 'react'
import { Container,Row,Col } from 'react-bootstrap';
import MyCard from '../MyCard';
export default class Load extends Component {
  render() {
      return (
      
            <Container>  
                加载中
                <Row>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                <Col Col lg={2} md={3} sm={4}><MyCard /></Col>
                </Row>
            </Container>
      )
  }
}
